document.addEventListener("DOMContentLoaded", () => {
    const burgerButton = document.getElementById("icon_side-bar_main");
    const burgerMenu = document.getElementById("sidebar_list_main");
    
    if (burgerButton || burgerMenu) {
      burgerButton.addEventListener("click", () => {
        burgerMenu.style.display =
          burgerMenu.style.display === "block" ? "none" : "block";
        console.log("Success");
      });
    } else {
      console.log("Error: One or both elements not found");
    }
  });
